function returnBox(longitude, latitude) {
    var lat = latitude;
    var long = longitude;
    console.log(lat);
    console.log(long);
    var latBounds = [];
    var longBounds = [];
    console.log(lat, long);
    //go through and find high and low bounds, push them to lat/long bounds.
    //first value in each array is upper bound, second value is lower
    if (latitudeArray.indexOf(lat) == true) {
      lat += .01;
    }
    if (longitudeArray.indexOf(long) == true) {
      long += .01;
    }
    for (var i = 0; i < latitudeArray.length; i++) {
      if (latitudeArray[i] > lat){
        latBounds.push(latitudeArray[i]);
        latBounds.push(latitudeArray[i-1]);
        break;
      }
      //error if reach last value
      else if (latitudeArray[i] >= 90){
        console.log("cannot find latitude");
      }
    }
    for (var i = 0; i < longitudeArray.length; i++) {
      if (longitudeArray[i] > long){
        longBounds.push(longitudeArray[i]);
        //west = longitudeArray[i].toFixed(6);
        longBounds.push(longitudeArray[i-1]);
        break;
      }
      else if (longitudeArray[i] >= 180){
        console.log("cannot find longitude");
      }
    }
    var upperLeft = [parseFloat(longBounds[0]),parseFloat(latBounds[1])]; //lowest long, highest lat (northwest)
    var upperRight = [parseFloat(longBounds[1]),parseFloat(latBounds[1])]; //highest long, highest lat (northeast)
    var bottomRight = [parseFloat(longBounds[1]),parseFloat(latBounds[0])]; //highest long, lowest lat (southeast)
    var bottomLeft = [parseFloat(longBounds[0]),parseFloat(latBounds[0])]; //lowest long, lowest lat (southwest)
    return [upperLeft,upperRight,bottomRight,bottomLeft,upperLeft];
}
/*

assignUserBox takes a request specifying the user's body._id to search by,
then the initial body.longitude and body.latitude to assign the user
to a boundary box for the duration of the session

It also assigns an updatedAt key to the user_session_boundary object that is
generated every time the route is accessed

I think later this can become a login screen of sorts

*/
router.put('/', function(req, res){
  var data = req.body;
  var query = data._id;
  var userBox = returnBox(data.longitude,data.latitude);
  console.log(userBox);
  var update = {
      user_session_boundary: {
        type: "Polygon",
        coordinates: [
          userBox
        ], //[-113.98274, 46.87278]
        updatedAt: new Date()
      }
    };
  var options = {new: true};
  console.log(data);
  //User.findOneAndUpdate() also works in this situation
  User.findByIdAndUpdate(
    query, //_id
    update, // new long and lat
    options, //add if doesn't exist
    function(err, documents){
    if(err){
      console.log(err);
    } else{
     res.send(data);
     console.log(data);
    }
  });
});

module.exports = router;
